pragma solidity ^0.4.24;

contract users_mp {
    
    //Event for new User Regisitration
    event NewUserRegistration(address user, string user_name, string last_name, 
        string email, string phone, string country, bool flag);
        
    /////////////////////////////// USERS or BUYERS ////////////////////////////
        struct User {
            string first_name;
            string last_name;
            string email;
            string phone;
            string country;
            uint balance;
            bool flag; //By default false but once new user register set it true
        }
        mapping (address => User) users;
        address[] public user_list;
        
        //Register New User
        function RegisterUser(string _first_name, string _last_name, string _email, string _phone, string _country) public  {
            //Return if user already exist
            if(users[msg.sender].flag)
                return;
            users[msg.sender] = User(_first_name, _last_name, _email, _phone, _country, msg.sender.balance,true);
            user_list.push(msg.sender)-1;
            
            emit NewUserRegistration(msg.sender, _first_name, _last_name, _email, _phone, _country, true);
        }
        function GetUserByAddress(address _userAddress) public view returns(string, string, string, string, string)
        {
            assert(_userAddress==address(0));
            return(users[_userAddress].first_name, users[_userAddress].last_name, users[_userAddress].email, 
                users[_userAddress].phone, users[_userAddress].country);
        }
        function GetUsersList() public view returns(address []) {
            return user_list;
        }
        function UsersCount() public constant returns(uint) {
            return user_list.length;
        }
        /*
        function IsUserExists(address _userAddress) public constant returns(bool) {
            assert(_userAddress==address(0));
            return(users[_userAddress].flag); //user already exist
        }
        */
        modifier onlyUser() {
            require(users[msg.sender].flag == true);
            _;
        }
    ////////////////////////////////////////////////////////////////////////////
}
